                grx.stroke();
            }

            var idx = 0;
            var id = setInterval(frame, 100);
            grx.lineWidth = 2;

                        idx++;
                        var r1 = circles[idx];

                        idx++;
                        x = circles[idx];
                    }
                    idx++;
                }
            }
